import React, {Component} from "react";

function Landing(){

    return(
        <div className="Landing-page">
            <h1> Stack Overflow: Kind Of </h1> <br/> <br/>
            <div className="sign-in-block">
                <form className="sign-in-form">
                    <input
                        type="text"
                        name="asdasdasd"
                        placeholder="asdasdasda"
                    />
                </form>
            </div>
        </div>
    )
}

export default Landing;
